            rolfkCRoles = System.Convert.ToInt32((sender as System.Windows.Forms.Button).Name.Split('|')[1]);
            if (periodID.HasValue)
            {
                var res = Owner.v.getaData("CALL getIdServiceROL('" + rolfkCRoles + "','" + periodID + "')");
