            pRoles.Visible = true;
            cloarControls();
            disableService(rolfkCRoles);
            LoadDataCrontrols(false, false, false, false, false, true, true);
            if (cmbxEco.Enabled)
                gbxCiclo.Text = "Agregar Ciclo Para Servicio: " + backgroundpanel.Controls.Find("Label" + rolfkCRoles, true)[0].Text;
        }
